import React ,{ useState, useEffect } from 'react'
import UseFetch from '../hooks/UseFetch';



const EditUser = () => {

    const [usersfromapi, setUsers] = useState([])
    const {loading , users} =UseFetch();
  
    useEffect(() => {
      
      setUsers(users);
    }, [])

   
    if (loading) {
      return <section>
        <p>Loading...</p>
      </section>
    }
      

    return (
        <>
            <h1>Update User!!!</h1>
        </>
    )
}

export default EditUser
